import React, { Component } from 'react'

import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

import Partners from './components/Partners'
import Staff from './components/Staff';
import Students from './components/Students';
import {SocketUser, socket} from './components/SocketUser';

//Join is login stuff

/*
  <Router>
    <Route path="/" exact component={Join} />
    <Route path="/chat" exact component={Chat} />
    <Route path="/socketuser" exact component={SocketUser} />
  </Router>
*/


/* DOES NOT WORK
          <Route path="/" >
            <Join />
          </Route>

          <Route path="/chat" >
            <Chat />
          </Route>

          <Route path="/socketuser">
            <SocketUser />
          </Route>
*/


class App extends Component{
  constructor(props){
    super(props);

    // const socket = this.socket;
    // console.log("LOOK HERE: " + socket);
    socket.emit('FINALLY', {msg: "FINALLY OMG PLEASE"});

  }

  // blah(){
  //   socket.emit('FINALLY', {msg: "FINALLY OMG PLEASE"});
  // }


  render(){
    return(
      <Router>
        <Switch>

          <Route exact path="/" >
            <Join socket = {socket}/>
          </Route>

          <Route exact path="/staff" >
            <Join socket = {socket}/>
          </Route>

          <Route exact path="/students" >
            <Chat socket = {socket}/>
          </Route>

          <Route exact path="/partners">
            <SocketUser socket = {socket}/>
          </Route>

        </Switch>
    </Router>
    )
  }

}



export default App;
